import './MyCars.css';
import * as React from 'react';
import Navbar from '../Navbar/Navbar';

function MyCars() {
  return (
    <div>
      <Navbar extra username="Daniel"/>

      <center>
      <Button color="success" variant="contained">Submit</Button>
      </center>
    </div>
  );
}

export default MyCars;
